  return (
    <div className={classes.container}>
      <div className={classes["nav-items"]}>
        <div>
        <NavLink
          to="/"
          className={({ isActive }) => (isActive ? classes.active : undefined)}
          end
        >
          Home
        </NavLink>
        <NavLink
          to="products"
          className={({ isActive }) => (isActive ? classes.active : undefined)}
        >
          Products
        </NavLink>

        </div>
        <div className={classes.cart}>
          <Link
